/* APP - JS */
import React from 'react';
import './App.css';

import Footer from '../src/';

function App() {
  return (
    <div className="App">
      <img src="https://img.icons8.com/nolan/64/video-playlist.png" alt="logo"/>
      <div className="titles">
        <h1>
          Player<br />Video
        </h1>
        <h2>
          To Upload. To compress. To view video files.
        </h2>
      </div>

      <Footer />
      {/* <footer>
        Presented by Sophie BAYRAM
      </footer> */}
    </div>
  );
}

export default App;
